import (
	context "context"
	inhereplease "github.com/imdb/fern/inhereplease"
	inherepleaseclient "github.com/imdb/fern/inhereplease/client"
	option "github.com/imdb/fern/inhereplease/option"
)

client := inherepleaseclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Imdb.CreateMovie(
	context.TODO(),
	&inhereplease.CreateMovieRequest{
		Title:  "title",
		Rating: 1.1,
	},
)

